import axios from 'axios';
const CategoryNews = (props) => {

    axios.get("http://localhost:80/news/backend/api/get/news-category", {
        params: {
            category: props.categoryName
        }
    })
    return (
        <h1>Category News</h1>
    )
}

export default CategoryNews;
